import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import RemovendoRepeticao from './page/RemovendoRepeticao';
import CriandoRepeticao from './page/CriandoRepeticao'
import SomaLetras from './page/SomaLetras';

ReactDOM.render(
  <React.Fragment>
    <div class="one"><RemovendoRepeticao/></div>
    <div  class="two">< CriandoRepeticao/></div>
    <div  class="three">< SomaLetras/></div>
  </React.Fragment>,
  document.getElementById('root')
);
